import './App.css';
import Layout from './components/shared/Layout';
import home from './components/home/homefrou';
import {useState} from "react";
import dummy from "./data/test.json"


function App() {
  const [isTrue, setIsTrue] = useState(false);
  function onClick() {
    setIsTrue(!isTrue);
  }
  return (
    <div>
      <Layout>    

        {dummy[2]}

        <div>
          <button onClick={onClick}>True?</button>
          {isTrue && <h1>True!</h1>}
          {!(isTrue) && <h1>false</h1>}
        </div>

      </Layout>
    </div>
  );
}

export default App;
